    <Router>
      <div className="App">
        <Route path="/login" exact component={Login} />
        <ProtectedRoute path="/welcome" exact component={Welcome} />
        <Route path="/register" exact component={Register} />
      </div>
    </Router>

  );
}
const ProtectedRoute = ({component:Component,...rest}) => {
